import React, { Component } from 'react'
import { Layout } from 'antd';
import { Switch, Route, Redirect } from 'react-router-dom'
import UserHead from '../../../components/UserHead';
import UserLeftNav from '../../../components/UserLeftNav';
import Center from '../Center'
import MyOrder from '../MyOrder'
import Passenger from '../Passenger';

const { Sider, Content } = Layout
export default class Home extends Component {
    render() {
        return (
            <div>
                <Header className="head">订票系统
                    <span style={{ marginLeft: '800px', fontSize: '15px' }}>
                        {
                            !user ? <Link to="/user/login" style={{ marginLeft: '20px' }}>登录</Link> : <span>{user.phone}<LinkButton onClick={this.logout} style={{ marginLeft: '20px' }}>退出</LinkButton></span>
                        }
                    </span>
                </Header>
                <Layout>
                    <Sider theme="light">
                        <UserLeftNav />
                    </Sider>
                    <Content>
                        <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
                            <Switch>
                                <Route path="/user/home/center" component={Center} />
                                <Route path="/user/home/myOrder" component={MyOrder} />
                                <Route path="/user/home/passenger" component={Passenger} />
                                <Redirect to="/user/home/center" />
                            </Switch>
                        </div>
                    </Content>
                </Layout>
            </div>
        )
    }
}
